window.bookSummaryJSON = "<p><b>In a world where darkness reigns, the cost of love is eternal.</b></p> <p>Eleyta's throne belongs to the most powerful vampire, and it's up to Sebastian and Luna to challenge the queen and save the realm.</p> <p>Unfortunately, that won't be easy. Having survived Queen Marguerite's deadly tournament, they are fugitives. Despite the peril lurking in the shadows, escape is not an option.</p> <p>The prophecy is hanging over their heads. The darkness is here, and the red moon will soon rise. Sebastian's bond with his maker must be broken, and they need to learn the tether's secrets before time runs out.</p> <p>As unyielding darkness threatens to consume them, Sebastian and Luna face their greatest challenge.</p> <p>The queen must be stopped, no matter the cost.</p> <p>Even if it's death.</p> <p><i>This is the third book in The Binding Chronicles, which should be listened to in order. This series is upper YA/NA and will have moderate steam as the series progresses. There are some instances of violence, language, and mature situations.</i></p>"; 
